import { Component } from "react";

export default class Search extends Component {
    render() {
        return (
            <div class={this.props.align + "search Glass-plate textfield"}>
                <input type="text" name="search" placeholder={this.props} />
                <img class="icon" alt="" src="https://img.icons8.com/ios-filled/50/ffffff/search.png" onClick={this.props.click} />
            </div>
        );
    }
}
